var started = false;

window.onload = init;

setTimeout(init, 5000);

function init() {
	if (started) {
		return null;
	}
	$('.loader').hide();

	started = true;
	
	//ScrollMagic Controller
	var controller = new ScrollMagic.Controller({});

	//Анимация появления на первом экране
	var header = new TimelineMax();

	header
		.add('start+=0.5')
		.from('.banner__title', 0.5, {
			transform: 'translateY(100%)',
			opacity: 0
		}, 'start')
		.from('.banner__text', 0.5, {
			transform: 'translateY(100%)',
			opacity: 0
		}, 'start')
		.from('.banner__box', 0.5, {
			transform: 'translateY(10%)',
			opacity: 0
		}, 'start+=0.2')
		.from('.banner__button', 0.5, {
			transform: 'translateY(50%)',
			opacity: 0
		}, 'start+=0.2')
		
	//Parallax эффект у коробки
	parallax('.banner__box', [{ obj: '.banner__box', mov: '-20' }], 'y');

	//Анимация появления плиток
	var tile1 = new TimelineMax();
	var tile2 = new TimelineMax();
	var tile3 = new TimelineMax();

	tile1
		.from('.tile__left--1', 0.5, {
			transform: 'translateY(50%)',
			opacity: 0
		})
		.from('.tile__right--1', 0.5, {
			transform: 'translateY(50%)',
			opacity: 0
		},'-=0.3')

	tile2
		.from('.tile__left--2', 0.5, {
			transform: 'translateY(50%)',
			opacity: 0
		})
		.from('.tile__right--2', 0.5, {
			transform: 'translateY(50%)',
			opacity: 0
		}, '-=0.3')

	tile3
		.from('.tile__left--3', 0.5, {
			transform: 'translateY(50%)',
			opacity: 0
		})
		.from('.tile__right--3', 0.5, {
			transform: 'translateY(50%)',
			opacity: 0
		}, '-=0.3')
		

	new ScrollMagic.Scene({ triggerElement: ".tile", duration: 0, triggerHook: '0.85' })
		.setTween(tile1)
		//.addIndicators({ name: "tile1" })
		.addTo(controller);

	new ScrollMagic.Scene({ triggerElement: ".tile__left--2", duration: 0, triggerHook: '1' })
		.setTween(tile2)
		//.addIndicators({ name: "tile2" })
		.addTo(controller);

	new ScrollMagic.Scene({ triggerElement: ".tile__left--3", duration: 0, triggerHook: '1' })
		.setTween(tile3)
		//.addIndicators({ name: "tile3" })
		.addTo(controller);

	//Parallax эффект у объектов на плитках
	parallax('.tile', [{ obj: '.tile__card', mov: '-15' }], 'x');
	parallax('.tile__left--2', [{ obj: '.tile__coin-big', mov: '-15' }], 'x');
	parallax('.tile__left--2', [{ obj: '.tile__coin-small', mov: '-15' }], 'x');
	parallax('.tile__left--3', [{ obj: '.tile__bag', mov: '-5' }], 'x');

	//Анимация 10%
	var ten = new TimelineMax();

	ten
		.add('start')
		.from('.get__back', 0.5, {
			transform: 'scale(0)'
		}, 'start')
		.from('.get__wrap', 0.5, {
			opacity: 0
		}, 'start+=0.2')
		.from('.get__circle', 0.5, {
			transform: 'scale(0)'
		}, 'start+=0.2')
		.add('ten')
		.staggerFrom(['.get__point--large', '.get__point--medium', '.get__point--small'], 1, {
			transform: 'scale(0)',
			ease: Elastic.easeOut.config(1, 0.3)
		}, 0.2, 'start+=0.2')
		.from('.get__percent', 0.5, {
			opacity: 0
		}, 'ten')
		.staggerFrom(['.get__star--1', '.get__star--2', '.get__star--3', '.get__star--4'], 1, {
			transform: 'scale(0)',
			ease: Elastic.easeOut.config(1, 0.3)
		}, 0.2, 'ten');

	new ScrollMagic.Scene({ triggerElement: ".get", duration: 0, triggerHook: '0.85' })
		.setTween(ten)
		//.addIndicators({ name: "get" })
		.addTo(controller);

	//Parallax эффект 10%
	parallax('.get', [{ obj: '.get__percent', mov: '-5' }]);

	//Анимация 500%
	var action = new TimelineMax();

	action
		.add('start')
		.from('.action__title', 0.5, {
			transform: 'translateY(100%)',
			opacity: 0
		})
		.staggerFrom(['.action__step--1', '.action__step--2', '.action__step--3'], 1, {
			transform: 'translateY(100%)',
			opacity: 0
		}, 0.2, 'start+=0.2')
		.from('.action__back', 0.5, {
			transform: 'scale(0)'
		}, 'start+=0.3')
		.from('.action__photo', 0.5, {
			opacity: 0
		}, 'start+=0.8')
		.from('.action__wrap', 0.5, {
			opacity: 0
		}, 'start+=0.8')
		.staggerFrom(['.action__triangle--3', '.action__triangle--2', '.action__triangle--1'], 1, {
			opacity: 0
		}, 0.2, '-=0.5')
		.staggerFrom(['.action__star--1', '.action__star--2', '.action__star--3', '.action__star--4'], 1, {
			transform: 'scale(0)',
			ease: Elastic.easeOut.config(1, 0.3)
		}, 0.2, '-=0.5');
		

	new ScrollMagic.Scene({ triggerElement: ".action", duration: 0, triggerHook: '0.65' })
		.setTween(action)
		//.addIndicators({ name: "action" })
		.addTo(controller);

	//Parallax эффект у карт
	// parallax('.card--1', [{ obj: '.card__card--1', mov: '-15' }]);
	// parallax('.card--2', [{ obj: '.card__card--2', mov: '-15' }]);
	$('.card__card').tilt({
		maxTilt: 10
	})
}

$(function() {

	//Логика работы калькулятора и отображения карточек

	var calculator = new Vue ({
		el: '#calculator',
		data: {
			total: 0,
			cafe: 0,
			month: 6,
			percentPromo: 0.05,
			percentOther: 0.01,
			percentIkea: 0.1,
			maxIkea: 3000,
			maxPromo: 1000,
			maxOther: 1000,
			actions: 500,
			summ: 0,
			ikea: ''
		},
		computed: {
			result: function() {
				var bTotal,
					bCafe,
					bIkea,
					result;
					
				if ((this.total - this.cafe) * this.percentOther > this.maxOther) {
					bTotal = this.maxOther;
				} else {
					bTotal = (this.total - this.cafe) * this.percentOther;
				}

				if (this.cafe * this.percentPromo > this.maxPromo) {
					bCafe = this.maxPromo;
				} else {
					bCafe = this.cafe * this.percentPromo;
				}

				if ((this.total * this.percentIkea) > this.maxIkea) {
					bIkea = this.maxIkea;
				} else {
					bIkea = this.total * this.percentIkea;
				}

				this.ikea = String(bIkea + this.actions * 4).replace(/(\d)(?=(\d{3})+([^\d]|$))/g, '$1 ');

				this.summ = (bTotal + bCafe) * this.month + bIkea + this.actions * 4;

				return String(this.summ).replace(/(\d)(?=(\d{3})+([^\d]|$))/g, '$1 ');
			}
		},
		mounted: function() {
			//Селекторы суммы
			//Total
			var rangeSlider = document.getElementById('range'),
				that = this;

			noUiSlider.create(rangeSlider, {
				start: [10000],
				step: 5000,
				connect: [true, false],
				range: {
					'min': [10000],
					'max': [120000]
				}
			});

			rangeSlider.noUiSlider.on('update', function (value) {
				var value = Math.round(value),
					result;

				//Если траты в кафе больше суммарных трат - делаем их равными
				if (value < that.cafe) {
					that.cafe = value;

					rangeSliderCafe.noUiSlider.set(value);
				}
				result = String(value).replace(/(\d)(?=(\d{3})+([^\d]|$))/g, '$1 ')
				$('.js-set-total-value').html(result);

				that.total = value;
			});

			//Cafe
			var rangeSliderCafe = document.getElementById('range2');

			noUiSlider.create(rangeSliderCafe, {
				start: [10000],
				step: 5000,
				connect: [true, false],
				range: {
					'min': [10000],
					'max': [120000]
				}
			});

			rangeSliderCafe.noUiSlider.on('update', function (value) {
				var value = Math.round(value),
					result;

				//Если траты в кафе больше суммарных трат - делаем их равными
				if (value > that.total) {
					value = that.total;

					rangeSliderCafe.noUiSlider.set(value);
				}
				result = String(value).replace(/(\d)(?=(\d{3})+([^\d]|$))/g, '$1 ')
				$('.js-set-cafe-value').html(result);

				that.cafe = value;
			});
		}
	})

	var list = new Vue({
		el: '#list',
		data: {
			minItems: 8,
			items: 0,
			step: 8,
			cardsOver: false,
			cards: [],
			category: 'Магазины IKEA' //Категория по умолчанию
		},
		methods: {
			getData: function () {
				var that = this;

				axios.get('cards.json')
					.then(function (response) {
						that.cards = response.data;
					})
					.catch(function (error) {
						console.log(error);
					});
			},
			setStatus: function (type) {
				if (type == 'ЭПС') {
					return 'Электронный сертификат';
				} else if (type == 'ПК') {
					return 'Подарочная карта';
				} else {
					return '';
				}
			},
			loadMore: function() {
				this.items += this.step;

				//console.log(this.cardsList.length);
				
				if (this.items >= this.cardsList.length) {
					this.cardsOver = true;
				}
			},
			beforeEnter: function(el) {
				//$(el).addClass('beforeEnter');
			},
			enter: function(el) {
				$(el).addClass('flipInY');
			},
			afterEnter: function (el) {
				$(el).removeClass('flipInY');
				
				//Parallax эффект у карт
				$('.cards__card').tilt({
					maxTilt: 10,
					disableAxis: 'x'
				})

			},
			leave: function(el) {
				$(el).addClass('flipOutY');
			},
			afterLeave: function (el) {
				$(el).removeClass('flipOutY');
			}
		},
		computed: {
			cardsList: function () {
				var that = this,
					cards;

				cards = this.cards.filter(function (item) {
					return item.category == that.category && item.cost <= calculator.$data.summ;
				}).sort(function (a, b) {
					if (a.partner > b.partner) return 1;
					if (a.partner < b.partner) return -1;
					if (a.partner == b.partner) {
						if (+a.value > +b.value) {
							return 1;
						}
						if (+a.value < +b.value) {
							return -1;
						}
						if (+a.value == +b.value) {
							return 0;
						}   
					};
				})
				
				
				if (cards.length <= this.items) {
					this.cardsOver = true;
				} else {
					this.cardsOver = false;
				}

				return cards;
			}
		},
		created: function () {
			this.getData();
			this.items = this.minItems;
		},
		mounted: function() {
			var that = this;

			//Подсветка активной категории
			$('body').on('click', '.js-set-active', function () {
				$('.js-set-active').removeClass('active');
				$(this).addClass('active');
			})

			//Вейпоинт для постепенного появления карточек
			this.$nextTick(function() {
				var cards = new Waypoint({
					element: document.querySelector('.cards__categories'),
					handler: function (direction) {
						$('.cards__card').each(function (i, item) {
							var id = +$(item).data('id');

							$(item).addClass('flipInY');
							$(item).css('animation-delay', (id * 100) + 'ms');

							setTimeout(function () {
								$('.cards__card').each(function (i, item) {
									$(item).removeClass('flipInY');
								})
							}, 1000)
						})

						this.disable();
					},
					offset: 'bottom-in-view'
				})
			})
		}
	})

	//Выбор категории
	var cf = false;

	var categories = $('#categories').selectize({
		hideSelected: true,
		onDropdownClose: function() {
			if (cf) {
				return null;
			}
			cf = true;
			var that = this;

			setTimeout(function(){
				that.close();
				cf = false;
			}, 100)
			
		}
	});
	var selectize = categories[0].selectize;

	categories.on('change', function (e) {
		router.setRoute($(e.target).val());
	})

	//Роутер
	var ikea = showCategory.bind(null, 'Магазины IKEA'),
		home = showCategory.bind(null, 'Дом и дети'),
		beauty = showCategory.bind(null, 'Красота и здоровье'),
		clothes = showCategory.bind(null, 'Одежда и аксессуары'),
		electronics = showCategory.bind(null, 'Электроника'),
		sport = showCategory.bind(null, 'Спорт и развлечения');
	
	var routes = {
		'/ikea': ikea,
		'/home': home,
		'/beauty': beauty,
		'/clothes': clothes,
		'/electronics': electronics,
		'/sport': sport
	};

	var router = Router(routes);

	router.init();

	function showCategory(category) {
		list.$data.category = category;
		list.$data.cardsOver = false;
		list.$data.items = list.$data.minItems;
		
		//Подсветка активной категории
		$('.js-set-active').removeClass('active');

		$('.js-set-active').each(function(i, item) {
			var catName = $(item).data('cat'),
				catVal = $(item).attr('href').substr(2);
				
			if (catName == category) {
				$(item).addClass('active');

				//Выбор активной категории в списке (на малых разрешениях)
				selectize.setValue(catVal, true);
			}
		})

		if (category !== 'Магазины IKEA') {
			$('.cards__categories').addClass('show-all');

			$('.cards__categories-m .selectize-input').removeClass('ikea-style');
		} else {
			//Раскрасим дропдаун в цвета Ikea!
			$('.cards__categories-m .selectize-input').addClass('ikea-style');
		}
	}

	//Раскрасим дропдаун в цвета Ikea!
	$('.cards__categories-m .selectize-input').addClass('ikea-style');

	//Выбор месяца
	$('#month').selectize();
	$('#month').on('change', function(e) {
		calculator.$data.month = $(e.target).val();	
	})

	//Заявка
	$('.js-open-modal').on('click', function (e) {
		e.preventDefault();

		$('body').addClass('modal-opened');
		var postfix = '&' + window.location.search.substring(1).split("&").join("&"),
			cardType = $(this).data('card');
		
		//console.log(postfix);
		
		if (cardType == 'gold') {
			iframe_src = 'https://appl.unicredit.ru/credit_cards?product_type=MC_Gold' + postfix;
		}
		if (cardType == 'standard') {
			iframe_src = 'https://appl.unicredit.ru/credit_cards?product_type=MC_Standard' + postfix;
		}
		
		$('#modal-iframe').prop('src', iframe_src);
	});

	$('.js-close-modal').on('click', function(e) {
		e.preventDefault();

		$('body').removeClass('modal-opened');
	})

	//Плавный скролл до якоря
	$('a.scroll').on('click', function (e) {
		e.preventDefault();
		var target_offset = $(this.hash).offset() ? $(this.hash).offset().top : 0;
	
		var customoffset = 0;

		$('html').removeClass('menu-opened');
		$('.hamburger').removeClass('is-active');

		$('html, body').animate({ scrollTop: Math.round(target_offset) - customoffset }, 1000);
	});
	
	//Открытие-закрытие мобильного меню
	$('.js-open-menu').on('click', function(e) {
		e.preventDefault();

		$('html').toggleClass('menu-opened');
		$('.hamburger').toggleClass('is-active');
	})

	//Показать все категории
	$('.js-show-more').on('click', function(e){
		e.preventDefault();

		$('.cards__categories').addClass('show-all');
		router.setRoute('home');
	})
});

function parallax(obj, targets, axis) {
	var timeout;
	$(obj).mousemove(function (e) {
		if (timeout) clearTimeout(timeout);
		setTimeout(callParallax.bind(null, e), 200);
	});

	function callParallax(e) {
		targets.forEach(function (target) {
			parallaxIt(e, target.obj, target.mov);
		})
	}

	function parallaxIt(e, target, movement) {
		var $this = $(obj);
		var relX = e.pageX - $this.offset().left;
		var relY = e.pageY - $this.offset().top;

		if (!axis) {
			TweenMax.to(target, 1, {
				x: (relX - $this.width() / 2) / $this.width() * movement,
				y: (relY - $this.height() / 2) / $this.height() * movement,
				ease: Power2.easeOut
			})
		} else if (axis === 'x') {
			TweenMax.to(target, 1, {
				x: (relX - $this.width() / 2) / $this.width() * movement,
				ease: Power2.easeOut
			})
		} else if (axis === 'y') {
			TweenMax.to(target, 1, {
				y: (relY - $this.height() / 2) / $this.height() * movement,
				ease: Power2.easeOut
			})
		}
		
	}
}